INSERT INTO `clasifications` (`idClasification`, `symbol`, `nameClasification`, `description`, `image`) VALUES
(1, 'E10', 'A PARTIR DE 10 AÑOS / A PARTIR DE 12 AÑOS', 'Los títulos clasificados con E10 (Todos +10) incluye contenido adecuado para mayores de 10 años. Los títulos de esta categoría pueden contener una mayor cantidad de violencia leve, de fantasía o de dibujos animados, lenguaje levemente soez o una mínima cantidad de temas insinuantes. La equivalencia de SMECCV es B (+12 años).', ),
(2, ' T', 'ADOLESCENTES / A PARTIR DE 15 AÑOS', 'Los títulos clasificados con T (Adolescentes) incluyen contenido adecuado para mayores de 13 años. Los títulos de esta categoría pueden contener violencia, temas insinuantes, humor vulgar, una mínima cantidad de sangre, apuestas simuladas o un uso poco frecuente de lenguaje muy soez. La equivalencia de SMECCV es B (+15 años).', ),
(3, 'M', 'MADURO / ADULTOS +18 AÑOS', 'Los títulos clasificados con M (Maduro) incluyen contenido adecuado para mayores de 17 años. Los títulos de esta categoría pueden contener violencia explícita, escenas sangrientas, contenido sexual o lenguaje muy soez. La equivalencia de SMECCV es B (+18 años).', );
INSERT INTO `clasifications` (`idClasification`, `symbol`, `nameClasification`, `description`, `image`) VALUES
(4, 'AO ', 'ADULTOS ÚNICAMENTE / EXCLUSIVO ADULTOS', 'Los títulos clasificados con AO (Adultos únicamente) incluyen contenido al que solo deben jugar mayores de 18 años. Los títulos de esta categoría pueden incluir escenas prolongadas de violencia explícita o contenido sexual gráfico y desnudos. Microsoft no admite títulos con la clasificación AO. La equivalencia de SMECCV es D (exclusivo adultos).\r\n\r\n', );

