INSERT INTO `products` (`idProducts`, `title`, `description`, `priceSale`, `name`, `model`, `stock`, `creatAt`, `pricePurchase`, `status`, `fkcategory`) VALUES
(1, 'Everspace / Xbox One Juego completo descargable', 'Descubre increíbles desafíos por un universo creado con detalles y en constante evolución gracias al juego completo descargable Everspace, para Xbox One o PC con Windows 10.\r\nEncontrarás un juego shooter de acción espacial para un jugador, con gráficos de primera calidad y una historia envolventemente cautivadora.\r\nDemuestra tus habilidades, técnicas y talento para la improvisación, para ir armando un verdadero rompecabezas espacial.\r\nTendrás disponibles 3 personajes con historias complejas y sus respectivas naves, con capacidades diferentes.\r\nObtendrás la descarga completa digital de Everspace, para instalar y jugar en tu consola Xbox One o en tu PC con Windows 10.\r\nSe te enviará un código en cuanto realices tu pago, y comenzarás a utilizarlo ahora mismo.', '529.99', 'Everspace', 'SE005MSE37', 5, '2021-12-31 17:08:57', '455.99', 1, 3),
(2, 'Animal Crossing New Horizons Edición Estándar para Nintendo switch Juego Físico', 'Con el videojuego Animal Crossing New Horizons Nintendo Switch tendrás la posibilidad de explorar y sacar el máximo partido de un nuevo universo, ya que podrás crear desde nuevas comodidades hasta herramientas útiles, usando tu habilidad con las plantas para interactuar con las flores y árboles de diferentes maneras, además de crear tus propias reglas. Este videojuego Animal Crossing New Horizons Nintendo Switch te permitirá disfrutar horas de diversión y emociones únicas', '1999.99', 'Animal Crossing New Horizons', 'SE005MSE50', 18, '2022-01-02 16:56:40', '1100.00', 1, 3),
(3, 'Silla Gamer Game Factor CGC600 V2 Azul', 'La silla CGC600-V2 de Game Factor está diseñada para elevar la experiencia gaming a un nivel de confort superior, poniendo especial atención en los pequeños detalles para que puedas pasar horas y horas jugando cómodamente, no importa si te gusta jugar casi acostado o en ángulo recto.', '4550.99', 'Game Factor CGC600 V2', 'SA595TSH37', 5, '2022-01-02 17:16:31', '3550.99', 1, 4),
(4, 'Escritorio A22 Gamer color Negro con azul', 'Resuelve las tareas de la escuela o la oficina con esta mesa para PC\r\n\r\nPasa divertidos momentos con este escritorio Gamer\r\n\r\nCuenta con amplia mesa para doble monitor y 3 repisas\r\n\r\nEs el artículo que te hace falta para tu oficina o home office\r\n\r\nProducto Importado de Brasil\r\n\r\nFabricado con los más altos estándares de calidad\r\n\r\nDa clic en tu tienda en línea y encuentra gran variedad de artículos para ti y tu familia. Los precios mas bajos a la puerta de tu hogar.', '2699.99', 'Escritorio A22', 'SE00A22S37', 7, '2022-01-02 17:23:19', '1555.99', 1, 4);

